import React from 'react';
import { ItemType } from './types';

const row = [[1,2,3],[4,5,6],[7,8,9]];
const GridView = () => {
  const onLastGridFilled = () => {
    const rowValues = row.map((item: ItemType) => item.id)
  }
  return <table style={{borderColor: 'blue'}}>{
    row.map((rowItem) => <td>{rowItem.map((cellItem) => <tr style={{width: 40, height: 40}}>{}</tr>)}</td>)
  }</table>
}

export default GridView
